Mongodb data extraction<p>I'm looking for some help on mongoDB. I'm doing a music Node project with mongodb and mongoose. I have 3 mongoose schema:</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>// define the schema for our user model
var userSchema = mongoose.Schema({
    _id: Schema.Types.ObjectId,
    local: {
        username: String,
        password: String
    },
    spotify: {
        id: String,
        token: String,
        username: String,
        profileUrl: String,
        email: String
    },
    deezer: {
        id: String,
        token: String,
        username: String,
        profileUrl: String,
        email: String
    },
    youtube: {
        id: String,
        token: String,
        displayName: String
    }
});

var musicSchema = mongoose.Schema({
  _id: Schema.Types.ObjectId,
  author_id: {
    type: Schema.Types.ObjectId,
    ref: 'User'
  },
  url: String,
  file: String,
  title: String,
  artistName: String,
  deezerId: Number,
  itunesId: Number,
  position: Number,
  duration: Number,
  deezerAlbum: Number,
  discNumber: Number,
  album: String,
  releaseDate: Date,
  nbTracks: Number,
  genreId: Number,
  cover: String,
  genre: String,
  creationDate: {
    type: Date,
    default: Date.now
  }
});

var playlistSchema = mongoose.Schema({
  _id: Schema.Types.ObjectId,
  name: String,
  author_id: {
    type: Schema.Types.ObjectId,
    ref: 'User'
  },
  contributor_id: [{
    type: Schema.Types.ObjectId,
    ref: 'User'
  }],
  tag: [String],
  importedPl: [String],
  musics: [Schema.Types.ObjectId],
  syncImportedPlaylist: {
    type: Boolean,
    default: false
  },
  autoAddSimilarSong: {
    type: Boolean,
    default: false
  },
  creationDate: {
    type: Date,
    default: Date.now
  }
});</code></pre>
</div>
</div>
</p>

<p>To explain briefly here's the thing. I have a User, Music and Playlist Schemas.
I would like to extract one Playlist with all the Music and the User inside so that the final JS object look like that:</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>{
  _id: someID
  name: String,
  author: {
    _id: someID
    local: {...},
    spotify: {...},
    deezer: {...},
    youtube: {...}
  },
  contributor: [{
    _id: someID
    local: {...},
    spotify: {...},
    deezer: {...},
    youtube: {...}
  }, {
    _id: someID
    local: {...},
    spotify: {...},
    deezer: {...},
    youtube: {...}
  }],
  musics_ids: [{
  _id: someID
  author: {
    _id: someID
    local: {...},
    spotify: {...},
    deezer: {...},
    youtube: {...}
  },
  url: String,
  file: String,
  title: String,
  ...allTheMusicSchemaInfo...: ...
}],
  ...allThePlaylistSchemaInfo...: ...
}</code></pre>
</div>
</div>
</p>

<p>I would like to replace ..._id fied by the data itself (ie replace author_id by user data, same for musics_ids).</p>

<p>Edit: Answer here (thx @matheusds): <a href="https://stackoverflow.com/a/48727050/7841588">https://stackoverflow.com/a/48727050/7841588</a></p>

