mongodb: how to compare String from document to the String constructed by expression in aggregation pipeline<p>I have a trouble with creating a view in MongoDB. I'm just starting with Mongo, so the question could look pretty silly.</p>

<p>I have the following document:</p>

<pre><code>{ 
    "_id" : NumberInt(12213054), 
    ... 
    "_dt" : {
        "_doc" : "time", 
        "time" : "01:30", 
        "date" : "04/02/18", 
        "tz" : "CET", 
        "tzoffset" : NumberInt(3600), 
        "uts" : NumberInt(1517704200)
    }, 
    ...
}
</code></pre>

<p>I'm trying to create a view for documents that have a date '04/02/18'.
The type of <code>"_dt.date"</code> field is <code>String</code>. And I'm trying to compare it using <code>$eq</code> operator.</p>

<p>I have the following query to select the data:</p>

<pre><code>{$match: {
    "_dt.date": {
        $eq: { 
            $concat: [  
                {$dateToString: {
                    format: "%d/%m/",
                    date: new Date("2018-02-04")
                }},
                {$substr: [
                    {$year : new Date("2018-02-04")},
                    2,
                    2
                ]}
            ]
        }
    }
}
}
</code></pre>

<p>But after I execute the query the result is empty.</p>

<p>The date string constructed by the subquery seems to be correct:</p>

<pre><code>db.matches.aggregate({ $project: { date:
{ 
            $concat: [
                {$dateToString: {
                    format: "%d/%m/",
                    date: new Date("2018-02-04")
                }},
                {$substr: [
                    {$year : new Date("2018-02-08")},
                    2,
                    2
                ]}
            ]
        }
}
}
)
</code></pre>

<p>Output is:</p>

<pre><code>{ 
    "_id" : NumberInt(12213054), 
    "date" : "04/02/18"
}
</code></pre>

<p>Does anyone have any idea why the first query doesn't work?</p>

