Mongo aggregation pipeline, finding out the total number of entries in an array per user<p>I have a collection, lets call it 'user'. In this collection there is a property entries, which holds a variably sized array of strings,</p>

<p>I want to find out the total number of these strings across my collection.</p>

<pre><code>db.users.find()
&gt; [{ entries: [] }, { entries: ['entry1','entry2']}, {entries: ['entry1']}]
</code></pre>

<p>So far I have have made many attempts here are some of my closest.</p>

<pre><code>     db.users.aggregate([
      { $project:
        { numberOfEntries:
          { $size: "$entries" } }
          },
           { $group: 
             {_id: { total_entries: { $sum: "$entries"}
                     }
                  } 
               }
            ])
</code></pre>

<p>What this gives me is a list of the users with the total number of entries, now what I want is each of the total_entries figures added up to get my total. Any ideas of what I am doing wrong. Or if there is a better way to start this?</p>

